) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='活动';

/*Data for the table `activity` */

/*Table structure for table `coupon` */

DROP TABLE IF EXISTS `coupon`;

CREATE TABLE `coupon` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `amount` decimal(10,2) NOT NULL COMMENT '优惠券金额',
  `explain` varchar(50) NOT NULL COMMENT '使用说明/门槛',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `total_number` int(11) DEFAULT NULL COMMENT '总数量 -1表示无限领取',
  `receive_number` int(11) NOT NULL COMMENT '领取人数',
  `status` tinyint(4) NOT NULL COMMENT '状态 1正常 2下架/领取完',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券';

/*Data for the table `coupon` */

