/*Table structure for table `parking_lot` */

DROP TABLE IF EXISTS `parking_lot`;

CREATE TABLE `parking_lot` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `parking_lot_number` varchar(50) NOT NULL COMMENT '停车场编号',
  `name` varchar(50) NOT NULL COMMENT '停车场名称',
  `address` varchar(200) NOT NULL COMMENT '停车场地址',
  `longitude` varchar(50) NOT NULL COMMENT '经度',
  `latitude` varchar(50) NOT NULL COMMENT '纬度',
  `province` varchar(20) NOT NULL COMMENT '省',
  `city` varchar(20) NOT NULL COMMENT '市',
  `area` varchar(20) NOT NULL COMMENT '区',
  `is_longrent` tinyint(4) NOT NULL COMMENT '是否支持长租办理 1有 2没有',
  `is_charging_pile` tinyint(4) NOT NULL COMMENT '是否有充电桩 1有 2没有',
  `image_urls` varchar(1000) NOT NULL COMMENT '停车场banner图',
  `total_charging_pile_number` int(11) DEFAULT NULL COMMENT '充电桩总数量',
  `surplus_charging_pile_number` int(11) DEFAULT NULL COMMENT '剩余充电桩数量',
  `total_park_number` int(11) NOT NULL COMMENT '总车位',
  `surplus_park_number` int(11) NOT NULL COMMENT '剩余车位',
  `open_time` varchar(50) NOT NULL COMMENT '开业时间',
  `end_time` varchar(50) NOT NULL COMMENT '结业时间',
  `price` decimal(10,2) NOT NULL COMMENT '价格/小时',
  `appoint_price` decimal(10,2) NOT NULL COMMENT '预约价格',
  `remark` varchar(50) NOT NULL COMMENT '说明',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='停车场信息';

